<p>
PrivilegedAction is an interface with a single method

column26:
you can do something like the following:

<pre>
  somemethod() {
       ...normal code here...
       String user = (String) AccessController.doPrivileged(
         new PrivilegedAction() {
           public Object run() {
               return System.getProperty("user.name");
           }
         }
       );
       ...normal code here...
 }
</pre>

<p>If the action performed in your <code>run</code> method could
throw a "checked" exception (those listed in the <code>throws</code> clause
of a method)

column27:
then you need to use the 
<code>PrivilegedExceptionAction</code> interface instead of the
<code>PrivilegedAction</code> interface:

<pre>
  somemethod() throws FileNotFoundException {
       ...normal code here...
     try {
       FileInputStream fis = (FileInputStream) AccessController.doPrivileged(
         new PrivilegedExceptionAction() {
           public Object run() throws FileNotFoundException {
               return new FileInputStream("someFile");
           }
         }
       );
     } catch (PrivilegedActionException e) {
       // e.getException() should be an instance of FileNotFoundException

column28:
       // as only "checked" exceptions will be "wrapped" in a
       // <code>PrivilegedActionException</code>.
       throw (FileNotFoundException) e.getException();
     }
       ...normal code here...
 }
</pre>

<p> Be *very* careful in your use of the "privileged" construct

column33:
rather than that of the current execution thread.
Code within a different context can thus call that method on the
previously-saved AccessControlContext object. A sample call is the
following:

<pre>

  acc.checkPermission(permission)

</pre> 

<p> There are also times where you don't know a priori which permissions
to check the context against. In these cases you can use the
doPrivileged method that takes a context:

<pre>
  somemethod() {
        AccessController.doPrivileged(new PrivilegedAction() {
             public Object run() {
                // Code goes here. Any permission checks within this
                // run method will require that the intersection of the
                // callers protection domain and the snapshot's
                // context have the desired permission.
             }
        }

